"""### Augmented

Now that we have our retrieval process set-up, we need to set up our "augmentation" process - AKA a prompt template.

The "A" in RAG (Retrieval-Augmented Generation) is fundamentally about combining ("Augmenting") the base language model's existing knowledge with relevant external information retrieved in real-time.
"""

from langchain_core.prompts import ChatPromptTemplate

RAG_PROMPT = """
CONTEXT:
{context}

QUERY:
{question}

You are a helpful assistant. Think deeply and use the available context to answer the question. If you can't answer the question, say you don't know.
"""

rag_prompt = ChatPromptTemplate.from_template(RAG_PROMPT)

"""### Generation

Last, but certainly not least, let's put the 'G' in 'RAG' by adding our generator - in this case, we can rely on Meta's [`LLama 3.3-70B`](https://huggingface.co/meta-llama/Llama-3.3-70B-Instruct) model!
"""

from langchain_groq import ChatGroq
model='llama-3.3-70b-versatile'
llm = ChatGroq(groq_api_key=userdata.get('GROQ_API_KEY'), model_name=model,temperature=0)

llama_chat_model = llm

"""### RAG - Retrieval Augmented Generation

All that's left to do is combine our R, A, and G into a single chain - and we're off!

The chain takes a question, splits it into two paths: one retrieves context, one passes the original question. Both feed into a prompt, then the model, then parser.

"""

from operator import itemgetter
from langchain.schema.output_parser import StrOutputParser

rag_chain = (
    {"context": itemgetter("question") | qdrant_retriever, "question": itemgetter("question")}
    | rag_prompt | llama_chat_model | StrOutputParser()
)

"""Let's test this out and make sure it works."""

user_question = input("Please enter your question: ")
rag_chain.invoke({"question": user_question})

