"""### Agent Creation Helper Function

Since we know we'll need to create agents to populate our agent nodes, let's use a helper function for that as well!

Notice a few things:

1. We have a standard suffix to append to our system messages for each agent to handle the tool calling and boilerplate prompting.
2. Each agent has its our scratchpad.
3. We're relying on Groq's function-calling API for tool selection
4. Each agent is its own executor.
"""

#Using groq
from langgraph.graph import StateGraph
from langchain_groq import ChatGroq
from langchain.agents import initialize_agent, AgentType
#Zero Shot Agent
def create_agent(
    llm: ChatGroq,
    tools: list,
    system_prompt: str,
) -> str:
    """Create a function-calling agent and add it to the graph using Groq."""

    # Update the system prompt with team members
    system_prompt += (
        "\nWork autonomously according to your specialty, using the tools available to you."
        " Do not ask for clarification."
        " Your other team members (and other teams) will collaborate with you with their own specialties."
    )
    # Assuming `ChatGroq` works similarly to other chat models in LangChain
    agent = initialize_agent(tools=tools,llm=llm,agent=AgentType.ZERO_SHOT_REACT_DESCRIPTION,verbose=True)
    return agent

"""### Supervisor Helper Function

Finally, we need a "supervisor" that decides and routes tasks to specific agents.

Since each "team" will have a collection of potential agents - this "supervisor" will act as an "intelligent" router to make sure that the right agent is selected for the right task.

Notice that, at the end of the day, this "supervisor" is simply directing who acts next - or if the state is considered "done".
"""

from langchain_core.messages import SystemMessage, HumanMessage

"""Takes an AI Model (llama 3.3 70b for now), some instructions (system_prompt) and a list of team members
This creates a template that tells the AI:

The main purpose of this function is to create a "supervisor" that can:
    Take in some situation
    Ask an AI to decide who should handle it next
    Return that decision in a clean format
    Only allow picking from approved team members or finishing the task

It needs to pick who goes next
It can only choose from our list of options (FINISH or team members)
It must always make a choice (that's what "required" means)
--
messages(system/human) creates another function inside our main function that handles each decision and it creates a list of two messages:
    Instructions for the AI (system_prompt)
    The current situation (input_data converted to text)
--
tool call = ...
arguments = ...

These lines:
    Get the AI's decision from its response
    Convert the decision from JSON format to Python format
    If anything goes wrong, they use empty defaults ({}) to avoid errors
--
"""

def create_team_supervisor(llm: ChatGroq, system_prompt, members) -> callable: #callable means it returns another function
    options = ["FINISH"] + members

    function_def = {
        "type": "function", # Tells the AI this is a function definition
        "function": {  # Contains all the function details
            "name": "route",  # The function is called "route"
            "description": "Select the next role", # What the function does
            "parameters": { # What inputs the function needs
                "type": "object", # Expects a JSON object/dictionary
                "properties": { # What properties this object can have
                    "next": { # Property called "next" that must be a string
                        "type": "string",
                        "enum": options, # Can only be values from our options list
                        "description": "The next role to act or FINISH" # Explains what "next" means
                    }
                },
                "required": ["next"]  # The "next" property must be provided
            }
        }
    }

# Define a function called 'supervisor' that takes one parameter 'input_data'
# Create a list of messages for the AI model
# Contains two types of messages: system instructions and human input

    def supervisor(input_data):
        messages = [
            # First message: System instructions that guide the AI's behavior
            SystemMessage(content=system_prompt),
            # Second message: Convert input_data to string and wrap it as a human message
            HumanMessage(content=str(input_data))
        ]
            # Send these messages to the AI model (llm) along with our function template
            # 'tools=[function_def]' tells the AI what response format to use
        response = llm.invoke(input=messages, tools=[function_def])

        # 1. Look for 'tool_calls' in additional_kwargs, if not found use [{}]
        # 2. Take the first item [0] from the list of tool calls

        tool_call = response.additional_kwargs.get('tool_calls', [{}])[0]

# Extract and parse the AI's decision:
    # 1. From tool_call, get 'function' field (default to empty dict if missing)
    # 2. From function, get 'arguments' field (default to '{}' if missing)
    # 3. Convert the JSON string to a Python dictionary using json.loads

        arguments = json.loads(tool_call.get('function', {}).get('arguments', '{}'))
        return arguments

    return supervisor

# Import necessary message types from langchain_core library
from langchain_core.messages import SystemMessage, HumanMessage
# Import json library for parsing JSON data
import json

# Define a function that creates a team supervisor
# Parameters:
#   llm: ChatGroq - an AI language model
#   system_prompt - instructions for the AI
#   members - list of team members
# Returns: a callable function (supervisor)
def create_team_supervisor(llm: ChatGroq, system_prompt, members) -> callable:
    # Create a list starting with "FINISH" followed by all team members
    # Example: if members = ["Alice", "Bob"], options = ["FINISH", "Alice", "Bob"]
    options = ["FINISH"] + members

    # Define the template for how the AI should structure its response
    function_def = {
        "type": "function",     # Indicates this is a function definition
        "function": {           # Contains the function specifications
            "name": "route",    # Name of the function
            "description": "Select the next role",  # What the function does
            "parameters": {      # What inputs the function expects
                "type": "object",    # Expects a JSON object
                "properties": {      # Define the properties of the object
                    "next": {        # Property named "next"
                        "type": "string",     # Must be a string value
                        "enum": options,      # Must be one of the values in options list
                        "description": "The next role to act or FINISH"  # Explains the purpose
                    }
                },
                "required": ["next"]  # The "next" property must be provided
            }
        }
    }

    # Define the inner supervisor function that handles individual decisions
    def supervisor(input_data):
        # Create a list of messages for the AI
        messages = [
            # System message containing instructions
            SystemMessage(content=system_prompt),
            # Human message containing the current situation
            HumanMessage(content=str(input_data))
        ]
        # Send messages to the AI model and get response
        response = llm.invoke(messages, tools=[function_def])

        # Safely handle the AI's response
        # Get the first tool call from response, default to empty dict if none exists
        tool_call = response.additional_kwargs.get('tool_calls', [{}])[0]

        # If we got a valid tool call
        if tool_call:
            # Parse the JSON arguments from the tool call
            # Uses nested .get() calls with defaults to handle missing data
            arguments = json.loads(tool_call.get('function', {}).get('arguments', '{}'))
        else:
            # If no tool call, return empty dict
            arguments = {}

        # Return the parsed arguments
        return arguments

    # Return the supervisor function for later use
    return supervisor

