"""### Research Team Graph Creation

Now that we have our research team agent nodes created, and our supervisor agent - let's finally construct our graph!

We'll start by creating our base graph from our state, and then adding the nodes/agent we've created as nodes on our LangGraph.
"""

# Define the structure for the research team's state
class ResearchTeamState(TypedDict):
    messages: Annotated[List[BaseMessage], operator.add]  # Chat history that can be combined
    next: str           # Who should act next
    input: str         # The original input text
    team_members: List[str]  # List of available team members

# Function to create the initial state
def create_entry_point(input_text: str):
    return ResearchTeamState(
        # Start with a human message containing the input
        messages=[HumanMessage(content=input_text)],
        # First actor should be the supervisor
        next="supervisor",
        # Store the original input
        input=input_text,
        # Define available team members
        team_members=["Search", "PaperInformationRetriever"]
    )

# Create a state graph to manage the workflow
research_graph = StateGraph(ResearchTeamState)

# Add three nodes to the graph:
# 1. Search capability
research_graph.add_node("Search", search_node)
# 2. Paper-specific research capability
research_graph.add_node("PaperInformationRetriever", research_node)
# 3. Supervisor to manage the workflow
research_graph.add_node("supervisor", supervisor_agent)

"""Now we can define our edges - include our conditional edge from our supervisor to our agent nodes.

Notice how we're always routing our agent nodes back to our supervisor!
"""

research_graph.add_edge("Search", "supervisor")
research_graph.add_edge("PaperInformationRetriever", "supervisor")
research_graph.add_conditional_edges(
    "supervisor",
    lambda x: x["next"],
    {"Search": "Search", "PaperInformationRetriever": "PaperInformationRetriever", "FINISH": END}
)

"""Now we can set our supervisor node as the entry point, and compile our graph!"""

research_graph.set_entry_point("supervisor")
chain = research_graph.compile()

